import 'dart:convert';
import 'dart:typed_data';

import 'package:flutter/material.dart';

class BantubeatImageProvider extends MemoryImage {
  BantubeatImageProvider() : super(decodeBase64(bantubeatDataUrl));

  static Uint8List decodeBase64(String dataUrl) {
    final components = dataUrl.split(',');
    final bytes = base64Decode(components[1]);
    return bytes;
  }

  static const bantubeatDataUrl =
      'data:image/png;base64,';
}
